import React from 'react';
import ReactDOM from 'react-dom';
import {checkUserLoggedIn} from './Utils.js';
import {
	BrowserRouter as Router,
	Switch,
	Redirect,
	Route,
	NavLink,
	useRouteMatch,
	Link
  } from "react-router-dom";

class List extends React.Component{

	render(){
		if(checkUserLoggedIn){
			const listArray = this.props.listArray;
			const listItems = listArray.map((list_item, index) =>
			  <li key={index}>
				  <p>
					  <i>{list_item.id}</i> <b>{list_item.title}</b>
				  </p>
			  </li>
			);
			return (
				<ul>{listItems}</ul>
			);
		} else {
			<Redirect to='/login' />
		}
	}

}

export default List;
